import React, { Component } from 'react'

export default class Contact extends Component {
  render() {
    return (
      <div>
        <h1>Contact</h1>
        You can find me on the interwebs! 
        <p />
        Want to see my resume? Check me out on Linkedin.
      </div>
    )
  }
}
